string = ''
#string = 'BANANA'

Score = {'Stuart': 0, 'Kevin': 0}

def longerV():
    for i in range(len(string)):
        for l in range(len(string)-i):
            if string[i:i+l+1][0] in 'AEIOU':
                Score['Kevin'] += 1
            else:
                Score['Stuart'] += 1


def shorterV():
 for i in range(len(string)):
     if string[i] in 'AEIOU':
         Score['Kevin'] += (len(string)-i)
     else:
         Score['Stuart'] += (len(string)-i)

#import timeit
#print(timeit.repeat(shorterV, number=1))
#print(timeit.repeat(longerV, number=1))
shorterV()
if Score['Kevin'] == Score['Stuart']:
    print('Draw')
else:
    print(max(Score, key=Score.get), Score[max(Score, key=Score.get)])
